import axios from 'axios';
const baseURL = 'http://localhost:3001/playlist'; // Thay thế bằng URL API thực tế của bạn

// Hàm đăng nhập
export const addVideo = async (src, name) => {
  try {
    const response = await axios.post(`${baseURL}/addVideo`, {
      src: src,
      name: name,
    });
    return response.data;

  } catch (error) {
    console.error('Error signing in:', error);
    throw error; // Ném lỗi để bên gọi xử lý
  }
};
